import './regionbottom.css';
import Cards from './../cards/Cards';
import product from '../../wirelessHeadphones';

const RegionBottom = () =>{
    return (
        <div className='region__bottom'>
            <div className='region__bottom__title'>
            Беспроводные наушники
            </div>
            <div className='region__bottom__cards'>
               {/*  <Cards title={product[0].title} img={product[0].img} price={product[0].price} oldprice={product[0].oldPrice} rate={product[0].rate}/>
                    <Cards title={product[1].title} img={product[1].img} price={product[1].price} oldprice={product[1].oldPrice} rate={product[1].rate}/>
                    <Cards title={product[2].title} img={product[2].img} price={product[2].price} oldprice={product[2].oldPrice} rate={product[2].rate}/>*/}
                {product.map((product) => (
                    <Cards key={product.id} title={product.title} img={product.img} price={product.price} oldprice={product.oldPrice} rate={product.rate} />
                ))}

            </div>
        </div>
    )
}

export default RegionBottom;
